	Arr_cstring={
		cstrings:[{word:"Hello",word_count:{}}]
	}

	onsubmit(){
		console.log(this.argv1);
	}



	render(){
		return(
		<div className="Nautstring">
        <header className="Nautstring-header">
             <form>
             	<h1>Hello World</h1>
		        <input type="text" name="cstring" id="cstring" ref={(c)=>this.argv1 = c} />
		        <button type="button" onClick={this.onsubmit} >Submit </button> 
             </form> 

        </header>
        </div>
 		);
	}
};

